import { Component, TemplateRef, ViewChild, OnInit, OnDestroy } from '@angular/core';
import { MatSnackBar } from '@angular/material/snack-bar';
import { MatDialog } from '@angular/material/dialog';
import { Product, ProductCategory, categories, categoryCamelCase } from '../product';
import { ProductService } from '../product.service';
import { Subscription } from 'rxjs';

@Component({
  selector: 'app-product-list-component',
  templateUrl: './product-list.component.html',
  styleUrls: ['./product-list.component.scss'],
  providers: []
})

export class ProductListComponent implements OnInit, OnDestroy {
  // MatDialog
  @ViewChild('dialogRef')
  dialogRef!: TemplateRef<any>;

  public serverFilteredProducts: Product[];
  public filteredProducts: Product[];

  // Unfiltered product list
  public allProducts: Product[];

  public name: string;
  public productBrand: string;
  public productCategory: ProductCategory;
  public productStore: string;
  public productLimit: number;
  getProductsSub: Subscription;
  getUnfilteredProductsSub: Subscription;

  // Boolean for if there are active filters
  public activeFilters: boolean;

  public categoriesList: ProductCategory[] = [
    'baked goods',
    'baking supplies',
    'beverages',
    'cleaning products',
    'dairy',
    'deli',
    'frozen foods',
    'herbs and spices',
    'meat',
    'miscellaneous',
    'paper products',
    'pet supplies',
    'produce',
    'staples',
    'toiletries',
  ];

  // Category collections for use in deleting products
  public bakingSuppliesProducts: Product[] = [];
  public bakedGoodsProducts: Product[] = [];
  public deliProducts: Product[] = [];
  public cleaningProducts: Product[] = [];
  public petSuppliesProducts: Product[] = [];
  public produceProducts: Product[] = [];
  public meatProducts: Product[] = [];
  public dairyProducts: Product[] = [];
  public frozenProducts: Product[] = [];
  public paperProducts: Product[] = [];
  public beverageProducts: Product[] = [];
  public herbProducts: Product[] = [];
  public stapleProducts: Product[] = [];
  public toiletriesProducts: Product[] = [];
  public miscellaneousProducts: Product[] = [];

  public categoryNameMap = new Map<ProductCategory, Product[]>();

  // temp variables to use for deletion
  public tempId: string;
  public tempName: string;
  public tempDialog: any;
  public tempDeleted: Product;
  constructor(private productService: ProductService, private snackBar: MatSnackBar, public dialog: MatDialog) { }

  openDeleteDialog(pname: string, id: string) {
    this.tempId = id;
    this.tempName = pname;
    this.tempDialog = this.dialog.open(this.dialogRef, { data: {name: this.tempName, _id: this.tempId} }, );
    this.tempDialog.afterClosed().subscribe((res) => {

      // Data back from dialog
      console.log({ res });
    });
  }

  getUnfilteredProducts(): void {
    this.unsubUnfiltered();
    this.getUnfilteredProductsSub = this.productService.getProducts().subscribe(returnedProducts => {
      this.allProducts = returnedProducts;
      this.makeCategoryLists();
    });
  }

  public makeCategoryLists(): void {
    categories.forEach((cat: ProductCategory) => {
      const categoryAsField = categoryCamelCase(cat);
      this[categoryAsField] = this.productService.filterProducts(
        this.allProducts, { category: cat }
      );
    });
  }

  getProductsFromServer(): void {
    this.unsub();
    this.getProductsSub = this.productService.getProducts({
      category: this.productCategory,
      store: this.productStore
    }).subscribe(returnedProducts => {
      this.serverFilteredProducts = returnedProducts;
      this.initializeCategoryMap();
      this.updateFilter();
    }, err => {
      console.log(err);
    });
    if (this.productCategory || this.productStore) {
      this.activeFilters = true;
    }
    else {
      this.activeFilters = false;
    }
  }

  // Sorts products based on their category
  initializeCategoryMap() {
    // eslint-disable-next-line prefer-const
    for (let givenCategory of this.categoriesList) {
      this.categoryNameMap.set(givenCategory,
        this.productService.filterProducts(this.serverFilteredProducts, { category: givenCategory }));

    }
    console.log(this.categoryNameMap);
  }

  public updateFilter(): void {
    this.filteredProducts = this.productService.filterProducts(
      this.serverFilteredProducts, { product_name: this.name, brand: this.productBrand , limit: this.productLimit });
      if (this.name || this.productBrand || this.productCategory || this.productStore) {
        this.activeFilters = true;
      }
      else {
        this.activeFilters = false;
      }

  }



  ngOnInit(): void {
    this.getProductsFromServer();
    this.getUnfilteredProducts();
  }

  ngOnDestroy(): void {
    this.unsub();
    this.unsubUnfiltered();
  }

  unsub(): void {
    if (this.getProductsSub) {
      this.getProductsSub.unsubscribe();
    }
  }

  unsubUnfiltered(): void {
    if (this.getUnfilteredProductsSub) {
      this.getUnfilteredProductsSub.unsubscribe();
    }
  }

  removeProduct(id: string): Product {
    this.productService.deleteProduct(id).subscribe(
      prod => {
        this.allProducts = this.allProducts.filter(product => product._id !== id);
        this.filteredProducts = this.filteredProducts.filter(product => product._id !== id);
          const categoryAsField = categoryCamelCase(prod.category);
          this[categoryAsField] = this[categoryAsField].filter(product => product._id !== id);
          this.tempDeleted = prod;
     }
    );
    this.tempDialog.close();
    this.snackBar.open('Product deleted', 'OK', {
      duration: 5000,
    });
    return this.tempDeleted;
  }

}
<!-- Form Fields and Search Bar ('Top' Content) -->
<div fxLayout="row">
  <div fxFlex fxFlex.gt-sm="80" fxFlexOffset.gt-sm="10">

    <mat-card class="search-card" fxLayout="row">
      <mat-card-content fxLayout="column">
        <mat-card-title class="user-list-title">Products</mat-card-title>
        <!-- Form Field Container -->
        <div fxLayout="row wrap" fxLayoutGap="15px" style="margin-right: 15px;">
          <mat-form-field class="input-field">
            <mat-label>Product Name</mat-label>
            <input matInput data-test="product_nameInput" placeholder="Filter products by name" [(ngModel)]="name"
              (input)="updateFilter()">
            <mat-hint>Filtered on client</mat-hint>
          </mat-form-field>

          <mat-form-field class="input-field">
            <mat-label>Brand</mat-label>
            <input matInput data-test="productBrandInput" placeholder="Filter products by brand"
              [(ngModel)]="productBrand" (input)="updateFilter()">
            <mat-hint>Filtered on client</mat-hint>
          </mat-form-field>
        </div>

        <!-- Selector/Tree Container -->
        <div fxLayout="row wrap" fxLayoutGap="15px">
          <mat-form-field class="input-field">
            <mat-label>Store</mat-label>
            <mat-select (selectionChange)="getProductsFromServer()" [(ngModel)]="productStore"
              data-test="productStoreSelect">
              <mat-option>--</mat-option>
              <mat-option value="Willies">Willies</mat-option>
              <mat-option value="Pomme de Terre">Pomme de Terre </mat-option>
              <mat-option value="Pomme de Terre/Willies">Pomme de Terre/Willies </mat-option>
              <mat-option value="Real Food Hub">Real Food Hub </mat-option>
              <mat-option value="Other">Other </mat-option>
            </mat-select>
            <mat-hint>Filtered on server</mat-hint>
          </mat-form-field>

          <mat-form-field class="input-field">
            <mat-label>Category</mat-label>
            <mat-select (selectionChange)="getProductsFromServer()" [(ngModel)]="productCategory"
              data-test="productCategorySelect">
              <mat-option>--</mat-option>
              <mat-option *ngFor="let category of categoriesList" [value]="category">{{category | titlecase }}</mat-option>
            </mat-select>
            <mat-hint>Filtered on server</mat-hint>
          </mat-form-field>
        </div>

        <br>


      </mat-card-content>

      <!-- Add Product Button -->
      <button mat-fab class="add-product-fab" matTooltip="Add Product" matTooltipPosition="left"
        routerLink="/products/new" data-test="addProductButton">
        <mat-icon class="md-24" aria-label="Add Product">add</mat-icon>
      </button>

    </mat-card>

  </div>
</div>

<div fxLayout="row">
  <div fxFlex fxFlex.gt-sm="80" fxFlexOffset.gt-sm="10" *ngIf="serverFilteredProducts; else productsError"
    style="width: 90%;">
    <mat-card *ngIf="activeFilters" class="conditional-product-list">
      <mat-card-content>
        <mat-nav-list class="filtered-product-nav-list">
          <span fxLayout="row" *ngFor="let product of this.filteredProducts">
            <a mat-list-item [routerLink]="['/products', product._id]" class="filtered-product-list-item">
              <p matLine class="product-list-name"> {{product.product_name}} </p>
              <p matLine class="product-list-brand"> Brand: {{product.brand}} </p>
              <p matLine class="product-list-category"> Category: {{product.category}} </p>
              <p matLine class="product-list-store"> Store: {{product.store}} </p>
              <mat-divider></mat-divider>
            </a>
            <div class="deleteContainer" style="position: absolute;">
              <button mat-icon-button class="delete-product-button" matTooltip="Delete Product"
                matTooltipPosition="left" (click)="openDeleteDialog(product.product_name, product._id)"
                data-test="deleteProductButton">
                <mat-icon aria-label="Delete Product">close</mat-icon>
              </button>
              <!-- Dialog Template -->
              <ng-template #dialogRef let-mydata>
                <h1 mat-dialog-title>Delete Product?</h1>
                <div mat-dialog-content>
                  <h4>Are you sure you want to delete <i>{{tempName}}</i>? This action cannot be undone</h4>
                </div>
                <div mat-dialog-actions>
                  <button mat-button color="warn" (click)="removeProduct(tempId)">Delete</button>
                  <button mat-button [mat-dialog-close]="" cdkFocusInitial>Cancel</button>
                </div>
              </ng-template>
            </div>
          </span>
        </mat-nav-list>
      </mat-card-content>
    </mat-card>

    <!-- All Products separated into categories and listed in dropdowns -->
    <mat-card class="expansion-product-panels">
      <mat-card-content>
        <mat-accordion>
          <mat-expansion-panel *ngFor="let productCategory of (this.categoryNameMap | keyvalue)">
            <mat-expansion-panel-header [ngClass]="productCategory.key.replace(' ', '-') + '-product-expansion-panel'">
              <mat-panel-title>
                {{ productCategory.key | titlecase }} ({{productCategory.value.length}})
              </mat-panel-title>
              <mat-panel-description>

              </mat-panel-description>
            </mat-expansion-panel-header>

            <!--Display All the Products in the Category-->
            <mat-nav-list [ngClass]="productCategory.key.replace(' ', '-') + '-product-nav-list'">
              <span fxLayout="row" *ngFor="let product of productCategory.value">
                <a mat-list-item [routerLink]="['/products', product._id]" class="product-list-item">
                  <p matLine class="product-list-name"> {{product.product_name | titlecase}} </p>
                  <p matLine class="product-list-brand"> {{product.brand | titlecase}} </p>
                  <p matLine class="product-list-category"> {{product.category | titlecase}} </p>
                  <p matLine class="product-list-store"> {{product.store | titlecase}} </p>
                  <mat-divider></mat-divider>
                </a>
                <div class="deleteContainer" style="position: absolute;">
                  <button mat-icon-button class="delete-product-button" matTooltip="Delete Product"
                    matTooltipPosition="left" (click)="openDeleteDialog(product.product_name, product._id)"
                    data-test="deleteProductButton">
                    <mat-icon aria-label="Delete Product">close</mat-icon>
                  </button>
                  <!-- Dialog Template -->
                  <ng-template #dialogRef let-mydata>
                    <h1 mat-dialog-title>Delete Product?</h1>
                    <div mat-dialog-content>
                      <h4>Are you sure you want to delete <i>{{tempName}}</i>? This action cannot be undone</h4>
                    </div>
                    <div mat-dialog-actions>
                      <button mat-button color="warn" (click)="removeProduct(tempId)">Delete</button>
                      <button mat-button [mat-dialog-close]="" cdkFocusInitial>Cancel</button>
                    </div>
                  </ng-template>
                </div>
              </span>
            </mat-nav-list>
          </mat-expansion-panel>
        </mat-accordion>
      </mat-card-content>
      <mat-card-actions>

      </mat-card-actions>
    </mat-card>
  </div>

  <ng-template #productsError>
    <div fxFlex fxFlex.gt-sm="80" fxFlexOffset.gt-sm="10" class="product-error">
      <mat-error>
        There was a problem loading the products. Possibly the server is down or perhaps there are network
        issues.
      </mat-error>
      <mat-error>
        Please wait a bit and try again.
      </mat-error>
    </div>
  </ng-template>

</div>

