            <mat-error data-test="categoryError" *ngIf="changeProductForm.get('category').hasError('required')">
              You must make a
              selection</mat-error>
            <mat-error
              *ngIf="changeProductForm.get('category').hasError('pattern') && !changeProductForm.get('category').hasError('required')">
            </mat-error>
          </mat-form-field>

        <b>Location:</b>
          <mat-form-field>
            <input matInput formControlName="location" data-test="locationInput">
            <mat-error *ngFor="let validation of changeProductFormMessages.threshold">
              <mat-error class="error-message" data-test="locationError"
                *ngIf="changeProductForm.get('location').hasError(validation.type) && (changeProductForm.get('location').dirty || changeProductForm.get('location').touched)">
                {{validation.message}}
              </mat-error>
            </mat-error>
          </mat-form-field>

        <b>Lifespan:</b>
          <mat-form-field>
            <input matInput formControlName="lifespan" data-test="lifespanInput">
            <mat-error *ngFor="let validation of changeProductFormMessages.lifespan">
              <mat-error class="error-message" data-test="lifespanError"
                *ngIf="changeProductForm.get('lifespan').hasError(validation.type) && (changeProductForm.get('lifespan').dirty || changeProductForm.get('lifespan').touched)">
                {{validation.message}}
              </mat-error>
            </mat-error>
          </mat-form-field>

        <b>Threshold:</b>
          <mat-form-field>
            <input matInput formControlName="threshold" data-test="thresholdInput">
            <mat-error *ngFor="let validation of changeProductFormMessages.threshold">
              <mat-error class="error-message" data-test="thresholdError"
                *ngIf="changeProductForm.get('threshold').hasError(validation.type) && (changeProductForm.get('threshold').dirty || changeProductForm.get('threshold').touched)">
                {{validation.message}}
              </mat-error>
            </mat-error>
          </mat-form-field>

        <div>
          <b>Description:</b>
            <textarea matInput name="Description" cols="40" rows="5"
              formControlName="description" data-test="descriptionInput"></textarea>
          </div>

        <div>
          <b>Notes:</b>
            <textarea matInput name="Notes" cols="40" rows="5" formControlName="notes"
              data-test="notesInput"></textarea>
          </div>
      </mat-card-content>
      <div fxLayout="row wrap" fxLayoutGap="25px">
      <mat-card-actions align="start">
        <button mat-raised-button type="button" color="primary" [disabled]="!changeProductForm.valid" type="submit"
          data-test="confirmChange">
          <mat-icon aria-label="Edit Product">edit</mat-icon>
          Confirm Edit
        </button>
      </mat-card-actions>

      <mat-card-actions class="add-to-pantry">
        <button color="primary" mat-raised-button type="button" (click)="openAddDialog(this.product)" data-test="addToPantryButton">
          <mat-icon aria-label="Pantry Product">local_parking</mat-icon>
          Add Product To Pantry
        </button>
      </mat-card-actions>

      <mat-card-actions class="add-to-shopping-list">
        <button color="primary" mat-raised-button type="button" (click)="openAddDialogShoppingList(this.product)" data-test="addToShoppingListButton">
          <mat-icon aria-label="Shopping List Product">shopping_cart</mat-icon>
          Add Product To Shopping List
        </button>
      </mat-card-actions>
    </div>

    </form>

import { Component, OnInit, OnDestroy } from '@angular/core';
import { ActivatedRoute } from '@angular/router';
import { Product } from '../product';
import { ProductService } from '../product.service';
import { AddProductComponent } from '../add-product/add-product.component';
import { Subscription } from 'rxjs';
import { FormBuilder, FormControl, FormGroup, Validators } from '@angular/forms';

@Component({
  selector: 'app-single-product-page',
  templateUrl: './single-product-page.component.html',
  styleUrls: ['./single-product-page.component.scss']
})
export class SingleProductPageComponent implements OnInit, OnDestroy {

  product: Product;
  changeProductForm: FormGroup;
  formExists: boolean;
  id: string;
  getProductSub: Subscription;

  constructor( private route: ActivatedRoute, private productService: ProductService, private fb: FormBuilder ) { }

  ngOnInit(): void {
    this.formExists = false;
    this.route.paramMap.subscribe((pmap) => {
      this.id = pmap.get('id');
      if (this.getProductSub) {
        this.getProductSub.unsubscribe();
      }
      this.getProductSub = this.productService.getProductById(this.id).subscribe(product => {
        this.product = product;
        this.createForms();
      });
    });
  }

  ngOnDestroy(): void {
    if (this.getProductSub) {
      this.getProductSub.unsubscribe();
    }
  }

  createForms() {
    this.changeProductForm = this.fb.group({
      _id: new FormControl(this.product._id),
      // eslint-disable-next-line @typescript-eslint/naming-convention
      product_name: new FormControl(this.product.product_name, Validators.compose([
        Validators.required,
        Validators.minLength(0),
        // In the real world you'd want to be very careful about having
        // an upper limit like this because people can sometimes have
        // very long names. This demonstrates that it's possible, though,
        // to have maximum length limits.
        Validators.maxLength(100),
        (fc) => {
          if (fc.value.toLowerCase() === 'abc123' || fc.value.toLowerCase() === '123abc') {
            return ({ existingName: true });
          } else {
            return null;
          }
        },
      ])),
      description: new FormControl(this.product.description, Validators.compose([
         Validators.maxLength(200),
      ])),
      brand: new FormControl(this.product.brand, Validators.compose([
        Validators.minLength(1), Validators.maxLength(100),
      ])),
      category: new FormControl(this.product.category, Validators.compose([
        Validators.required,
        Validators.pattern('^(baked goods|baking supplies|beverages|cleaning products|dairy|deli|' +
          'frozen foods|herbs and spices|meat|paper products|pet supplies|produce|staples|toiletries|miscellaneous)$')
      ])),
      store: new FormControl(this.product.store, Validators.compose([
        Validators.required, Validators.minLength(1), Validators.maxLength(100),
      ])),
      location: new FormControl(this.product.location, Validators.compose([
        Validators.maxLength(100),
      ])),
      notes: new FormControl(this.product.notes, Validators.compose([
       Validators.maxLength(200),
      ])),
      lifespan: new FormControl(this.product.lifespan, Validators.compose([
        Validators.min(0), Validators.max(1000000), Validators.pattern('^[0-9]+$')
      ])),
      threshold: new FormControl(this.product.threshold, Validators.compose([
        Validators.required, Validators.min(0), Validators.max(1000000), Validators.pattern('^[0-9]+$')
      ]))
    });
    this.formExists = true;
  }

}
<div fxLayout="row">
  <div fxFlex fxFlex.gt-sm="80" fxFlexOffset.gt-sm="10">
    <app-product-card [changeProductForm]="this.changeProductForm"
    [product]="this.product"
    [formExists]="this.formExists"></app-product-card>

  </div>
</div>

